Мы добавили в Приложение новый раздел "Споры", надеемся, вам он понравится.
Только, пожалуйста, не путайте ни с тотализатором ни со ставками. Ибо тут вы можете создавать любой предмет спора, все ограниченно только вашей фантазией, а игра идет не на деньги, а на виртуальные очки и не против "конторы", а против конкретных оппонентов.
Это не способ заработка, а попытка развлечь вас при просмотре даже самого скучного матча, из которого можно сделать интереснейший предмет спора.

Обе российские лиги РПЛ и ФНЛ;
Текстовые онлайн трансляции матчей;
Push-уведомления о событиях в матче с участием любой команды;
Составы команд и статистика по каждому игроку;
Календарь и расписание матчей по датам и турам с возможностью отфильтровать для любой из команд;
Оформление в цветах любимого клуба;
Возможность загрузки собственных обоев.
